import React, { useState } from "react";

function GetMath() {
  const [items, setItems] = useState([]);

  const getData = () => {
    setItems([
      ...items,
      {
        id: items.length,
        value: Math.floor(Math.random() * 10) + 1,
        user:
          "user" +
          Math.floor(Math.random() * 10) * Math.floor(Math.random() * 10),
      },
    ]);
    console.log("Getting new data", items);
  };

  return (
    <div className="container">
      <div className="row">
        <button className="col" onClick={getData}>
          Get Data
        </button>
        <div className="col">{JSON.stringify(items)}</div>
        <div className="col">
          {items.map((item) => (
            <div key={item.id}>
              {`${item.user}: `}
              {item.value}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default GetMath;
